//   </svg>
//   <div class="absolute z-10 w-full py-2 mt-1 bg-white border rounded-md shadow-lg top-10 left-0 hidden">
//     <ul>
//       <li class="px-3 py-1 cursor-pointer hover:bg-gray-100">Suggestion 1</li>
//       <li class="px-3 py-1 cursor-pointer hover:bg-gray-100">Suggestion 2</li>
//       <li class="px-3 py-1 cursor-pointer hover:bg-gray-100">Suggestion 3</li>
//     </ul>
//   </div>
// </div>

    </div>
      </ul>
   
   
   
    </div>
 <div className="container">
        <ul>
          {datapasien.map((pasien) => (
            <li key={pasien.id}>{pasien.nama_lengkap}</li>
          ))}
        </ul>
      </div>




    
    </>
  )
}

export default Pendaftaran
